import React from "react";
import Router from "next/router";
import NavBar from "../components/navbar";

function IndexPage() {
  return (
    <div>
      <NavBar />
      Hello Next.js
      <button onClick={() => Router.push("/posts")}>Go to Posts</button>
    </div>
  );
}

export default IndexPage;
